#include <string>
#include <iostream>
#include <vector>
#include <map>
#include <set>

using namespace std;

class Solution
{
public:
    string minWindow(string s, string t)
    {
        map<char, pair<int, int>> freq;
        int need = 0;
        for (char c : t)
        {
            // need_
            freq[c].first++;
            // have_
            freq[c].second = 0;
            need += 1;
        }
        string min_substr = "";
        int start = 0, end = 0, have = 0, size_s = static_cast<int>(s.size()), size_t = static_cast<int>(t.size()), min_substr_size = INT_MAX;

        while (end < size_s)
        {
            if (freq.find(s[end]) != freq.end())
            {
                if (freq[s[end]].second < freq[s[end]].first)
                    have += 1;
                freq[s[end]].second++;
            }
            if (need == have)
            {
                while (have == need)
                {
                    if ((end - start) < min_substr_size)
                    {
                        min_substr = s.substr(start, end - start + 1);
                        min_substr_size = static_cast<int>(min_substr.size());
                    }
                    if (freq.find(s[start]) != freq.end())
                    {
                        freq[s[start]].second--;
                        if (freq[s[start]].second < freq[s[start]].first)
                            have -= 1;
                    }
                    start++;
                }
            }
            end += 1;
        }
        return min_substr;
    }
};

int main()
{
    Solution *sol = new Solution();
    cout << "Solution is: " << sol->minWindow("", "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ");
    return 0;
}
